import React from 'react';

import './Footer.scss';

const Footer = () => {
  return (
    <div className="footer">
      <a className="footer__link" href="https://github.com/Team1-TeliaProject">
        About us
      </a>
      <a className="footer__link" href="https://github.com/Team1-TeliaProject">
        Privacy Policy
      </a>
    </div>
  );
};

export default Footer;
